import React from 'react';

export default class Cardsitem extends React.Component {
  goCardPage = () => {
    let { index, name } = this.props;
    this.props.history.push({
      pathname: '/card/' + name,
      index: index,
    });
  };

  render() {
    let { img, name, age } = this.props;

    return (
      <div className='cards' onClick={this.goCardPage}>
        <img src={img} alt='' />
        <h1>{name}</h1>
        <p>{age}</p>
      </div>
    );
  }
}
